import React from 'react';
import BookForm from './BookForm';

const Add = () => {
  const handleOnSubmit = (book) => {
    console.log(book);
  };

  return (
    <React.Fragment>
      <AddForm handleOnSubmit={handleOnSubmit} />
    </React.Fragment>
  );
};

export default Add;
